    font-weight: bold;
    color: rgb(105, 48, 44);
`
const Subtitle = styled.div`
    font-size: 24px;
    font-weight: 500;
    color: rgb(105, 48, 44);
`

class App extends Component {
    render() {
        return (
            <div class="container">
                <div class="row">
                    <div class="col">
                    <Head><h1>ถ้าพูดเยอะอาจจะเจ็บคอ
                    <br/>แต่ถ้ามา Talk n' Chip 2019
                    <br/>แล้วพูดไม่พอจะเสียใจ</h1></Head>
                    </div>
                    </div>
                        <div class="row">
                            <div class="m-0 col-12 col-md-5 col-lg-3">
                                <a class="sc-bxivhb fyBEG" href="/submit">
                                    <button class="sc-bdVaJa hYkVrm btn btn-secondary btn-block">ส่งหัวข้อที่จะไปพูดกันเลย !</button>
                                </a>
                            </div>
                            <div class="py-2 mt-1 my-0 pl-1 col-12 col-md-7 col-lg-9">
                                <div class="sc-bZQynM bxwziZ">
                                    <span class="mx-3">หรือ</span>
                                    <a class="sc-htpNat hRYmfK" href="/vote">ดูหัวข้อที่น่าสนใจ&gt;</a>
                                </div></div></div>

                                </div>
                    );
                  }
                }
export default App
